import React, { useState } from "react";
import {
  Nav,
  NavItem,
  NavLink,
  
} from "reactstrap";

const Navi = (args) => {
  return (
    <div>
      <Nav>
        <NavItem>
          <NavLink active href="#">
            Link
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Another Link</NavLink>
        </NavItem>
        <NavItem>
          <NavLink  href="#">
            Disabled Link - {this.props.cart.length}
          </NavLink>
        </NavItem>
      </Nav>
      Copy Name Description Default Control tabs - pills - vertical
    </div>
  );
};

export default Navi;
